const UserList = () => {
  const [dummy, setDummy] = useState([
    {
      id: 0,
      name: 'Kim',
      username: 'narciss',
      email: 'private.narc2ss@gmail.com',
    },
    {
      id: 1,
      name: 'Jang',
      username: 'narciss',
      email: 'private.narc2ss@gmail.com',
    },
    {
      id: 2,
      name: 'Soo',
      username: 'narciss',
      email: 'private.narc2ss@gmail.com',
    },
  ]);
  return <h1>userlist</h1>;
};

export default UserList;
